import "..components/TypingEffect";

export default function Home() {
    return (
        <section id="home">
                    <div class="container">
                        <h1>Hello, <br/>
                            my name is Yung-Chu, <br/>
                            and I am a <span class="typed-text"></span><span class="cursor">&nbsp;</span></h1>
                    </div>
        </section>
    );
}
